-- Create the temp table first
DROP TABLE IF EXISTS #TMPREG;
CREATE TABLE #TMPREG (
    Path_ID NVARCHAR(50),
    Country NVARCHAR(10),
    Zipcode NVARCHAR(50),
    D NVARCHAR(MAX)
);

-- Insert using XMLNAMESPACES + computed columns
WITH XMLNAMESPACES(DEFAULT 'http://www.w3.org/2000/svg')
INSERT INTO #TMPREG (Path_ID, D, Country, Zipcode)
SELECT
    path.value('@id', 'NVARCHAR(100)') AS Path_ID,
    path.value('@d', 'NVARCHAR(MAX)') AS D,
    LEFT(path.value('@id', 'NVARCHAR(50)'), CHARINDEX('-', path.value('@id', 'NVARCHAR(50)')) - 1) AS Country,
    SUBSTRING(path.value('@id', 'NVARCHAR(50)'), CHARINDEX('-', path.value('@id', 'NVARCHAR(50)')) + 1, LEN(path.value('@id', 'NVARCHAR(50)'))) AS Zipcode
FROM
    @xml.nodes('/svg/g/g/path') AS Paths(path);


-- Expand numeric zipcodes if aggregated
WITH ZipcodeExpanded AS (
	select 
		Path_ID
		, Country
		, cast(left(Zipcode, charindex('-', Zipcode) - 1) as int) as 'StartCode'
		, cast(right(Zipcode, len(Zipcode) - charindex('-', Zipcode)) as int) as 'EndCode'
	from #TMPREG
	where Zipcode like '%-%'
),
RecursiveRange AS (
	select 
		Path_ID
		, Country
		, StartCode AS PostalCode
		, EndCode
	from ZipcodeExpanded

	UNION ALL
	
	select 
		Path_ID
		, Country
		, PostalCode + 1
		, EndCode
	from RecursiveRange
	where PostalCode + 1 <= EndCode
)
INSERT INTO #TMPREG(Path_ID, Country, Zipcode, D)
	select
		r.Path_ID
		, r.Country
		, FORMAT(r.PostalCode, '00') as 'Zipcode'
		, t.D
	from RecursiveRange r
	inner join #TMPREG t (nolock) on t.Path_ID = r.Path_ID

delete from #TMPREG
where Zipcode like '%-%'

-- Truncate target table
TRUNCATE TABLE dbo.svg_ctry_zip_EU

-- Insert data into target table
INSERT INTO dbo.svg_ctry_zip_EU (Path_ID, Country, Zipcode, D)
	select Path_ID, Country, Zipcode, D from #TMPREG